import React from 'react'
import {
  ChakraProvider,
  Text
} from '@chakra-ui/react'
import theme from './theme/theme'
import './App.css';

function App() {
  return (
    <ChakraProvider theme={theme}>
        <Text color='instagramColor'>Hello World.</Text>
    </ChakraProvider>
  );
}

export default App;
